INSERT INTO `contratos` VALUES ('1.1 - Quando empregadas no presente contrato, e/ou documentos relacionados com a\r\nexecução dele, as denominações adiante relacionadas significarão, respectivamente:\r\na) PROPOSTA DE ADESÃO: documento firmado pelas Partes, a este explicitamente\r\nvinculado e que deste passará a ser parte integrante e indissociável, onde constarão\r\nos dados de identificação e qualificação da EMPRESA, identificação e qualificação\r\ndo(s) representantes(s) legal(is) e/ou autorizado(s) dessa, e as condições comerciais\r\nno âmbito deste Contrato de Prestação de Serviços;\r\nb) CARTÃO BRB TICKET RESTAURANTE® ou CARTÃO: cartão magnético\r\nfornecido à EMPRESA, cadastrada, correntista ou não do Banco Regional de Brasília -\r\nBRB e entregue ao USUÁRIO para a realização de TRANSAÇÃO na rede de\r\nESTABELECIMENTOS credenciados; \r\n2\r\nc) ESTABELECIMENTO: os estabelecimentos comerciais, voltados ao segmento de\r\nrestaurante, tais como restaurantes, lanchonetes, padarias e similares, identificados\r\ncom a bandeira TICKET;\r\nd) EXTRATO DO CARTÃO: relatório impresso, que discrimina as despesas e os\r\ncréditos apurados no CARTÃO;\r\ne) PEDIDO DE CRÉDITO: é a relação encaminhada pela EMPRESA à\r\nCONTRATADA, contendo o nome, CPF do USUÁRIO, o valor do benefício, a serem\r\ndisponibilizados nos CARTÕES;\r\nf) SISTEMA CARTÃO BRB TICKET RESTAURANTE® ou SISTEMA: conjunto de\r\nprocessos tecnológicos e operacionais de gerenciamento de transações realizadas\r\nentre USUÁRIO e ESTABELECIMENTO, por meio de cartão eletrônico, para\r\naquisição de refeições prontas em restaurantes e em estabelecimentos similares, em\r\nconformidade com a legislação do Programa de Alimentação do Trabalhador - PAT;\r\ng) SENHA: código eletrônico secreto, individualizado para cada CARTÃO,\r\nencaminhado à EMPRESA em envelope lacrado, a qual será sempre responsável pela\r\nentrega ao USUÁRIO, constituindo sua utilização assinatura eletrônica do USUÁRIO,\r\nvalendo para todos os efeitos da lei e do contrato, como expressão inequívoca de sua\r\nvontade, especialmente por ocasião de TRANSAÇÕES junto ao\r\nESTABELECIMENTO credenciado;\r\nh) TRANSAÇÃO: legítima operação comercial de aquisição de refeições prontas,\r\nmediante a utilização do CARTÃO, transmitida por equipamentos ou de forma manual,\r\nconforme especificações contidas no folheto de utilização do CARTÃO, realizada entre\r\no USUÁRIO e o ESTABELECIMENTO;\r\ni) USUÁRIO: pessoa física designada para portar o CARTÃO BRB TICKET\r\nRESTAURANTE® e habilitado a realizar TRANSAÇÃO na rede de\r\nESTABELECIMENTO credenciada, por meio da SENHA de autorização;\r\nj) CONTRATADA: prestadora de serviços de implantação e gerenciamento do\r\nSISTEMA de CARTÃO BRB TICKET RESTAURANTE®;\r\nk) EMPRESA: pessoa jurídica, com sede no País, com inscrição no Cadastro Nacional\r\nde pessoa jurídica ou Cadastro Geral de Contribuintes do ministério da Fazenda'),('1.1 - Quando empregadas no presente contrato, e/ou documentos relacionados com a\r\nexecução dele, as denominações adiante relacionadas significarão, respectivamente:\r\na) PROPOSTA DE ADESÃO: documento firmado pelas Partes, a este explicitamente\r\nvinculado e que deste passará a ser parte integrante e indissociável, onde constarão\r\nos dados de identificação e qualificação da EMPRESA, identificação e qualificação\r\ndo(s) representantes(s) legal(is) e/ou autorizado(s) dessa, e as condições comerciais\r\nno âmbito deste Contrato de Prestação de Serviços;\r\nb) CARTÃO BRB TICKET RESTAURANTE® ou CARTÃO: cartão magnético\r\nfornecido à EMPRESA, cadastrada, correntista ou não do Banco Regional de Brasília -\r\nBRB e entregue ao USUÁRIO para a realização de TRANSAÇÃO na rede de\r\nESTABELECIMENTOS credenciados; \r\n2\r\nc) ESTABELECIMENTO: os estabelecimentos comerciais, voltados ao segmento de\r\nrestaurante, tais como restaurantes, lanchonetes, padarias e similares, identificados\r\ncom a bandeira TICKET;\r\nd) EXTRATO DO CARTÃO: relatório impresso, que discrimina as despesas e os\r\ncréditos apurados no CARTÃO;\r\ne) PEDIDO DE CRÉDITO: é a relação encaminhada pela EMPRESA à\r\nCONTRATADA, contendo o nome, CPF do USUÁRIO, o valor do benefício, a serem\r\ndisponibilizados nos CARTÕES;\r\nf) SISTEMA CARTÃO BRB TICKET RESTAURANTE® ou SISTEMA: conjunto de\r\nprocessos tecnológicos e operacionais de gerenciamento de transações realizadas\r\nentre USUÁRIO e ESTABELECIMENTO, por meio de cartão eletrônico, para\r\naquisição de refeições prontas em restaurantes e em estabelecimentos similares, em\r\nconformidade com a legislação do Programa de Alimentação do Trabalhador - PAT;\r\ng) SENHA: código eletrônico secreto, individualizado para cada CARTÃO,\r\nencaminhado à EMPRESA em envelope lacrado, a qual será sempre responsável pela\r\nentrega ao USUÁRIO, constituindo sua utilização assinatura eletrônica do USUÁRIO,\r\nvalendo para todos os efeitos da lei e do contrato, como expressão inequívoca de sua\r\nvontade, especialmente por ocasião de TRANSAÇÕES junto ao\r\nESTABELECIMENTO credenciado;\r\nh) TRANSAÇÃO: legítima operação comercial de aquisição de refeições prontas,\r\nmediante a utilização do CARTÃO, transmitida por equipamentos ou de forma manual,\r\nconforme especificações contidas no folheto de utilização do CARTÃO, realizada entre\r\no USUÁRIO e o ESTABELECIMENTO;\r\ni) USUÁRIO: pessoa física designada para portar o CARTÃO BRB TICKET\r\nRESTAURANTE® e habilitado a realizar TRANSAÇÃO na rede de\r\nESTABELECIMENTO credenciada, por meio da SENHA de autorização;\r\nj) CONTRATADA: prestadora de serviços de implantação e gerenciamento do\r\nSISTEMA de CARTÃO BRB TICKET RESTAURANTE®;\r\nk) EMPRESA: pessoa jurídica, com sede no País, com inscrição no Cadastro Nacional\r\nde pessoa jurídica ou Cadastro Geral de Contribuintes do ministério da Fazenda');
